import "./App.css";
import { useEffect, useState } from "react";

function App() {
  const [items, setItems] = useState(null);

  useEffect(() => {
    fetch("http://localhost:3000/posts")
      .then((res) => {
        return res.json();
      })
      .then((data) => {
        console.log(data);
        setItems(data);
      });

    //fetch('http://localhost:3000/posts').then((response) => response.json()).then((data)=>{console.log(data); setItems([data]);    setTimeout(()=>{  console.log(items)},3000)});
  }, []);

  return (
    <div className="App">
      {items !== null &&
        items.map((item) => {
          return <div>{item.content}</div>
        })}
    </div>
  );
}

export default App;
